      {id:6 ,  img :  "https://picsum.photos/206" , name : 'Mouad',position : 'Administrator',phone : '+21359113887',email : 'Mouad.Admin@gmail.com',website : 'AdminMouad.com',}
    ]
    const members = info.map(member => <TeamMember //member est un parametre qui represente chaque ligne dans la MAP
               // C le principe des boucles     
                  key={member.id}
                    img={member.img}
                    name={member.name}
                    position={member.position}
                    phone={member.phone}
                    mail={member.email}
                    website={member.website}
    />);
    return(
        <div className="row">

       < TeamMember 
       />

       </div>
    );
}
export default Team ;
